css:
atom-text-editor,
:host {
  background-color: #141414;
  color: #f3efe8;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #282a2e;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #282a2e;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #373b41;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #282a2e;
  color: #f3efe8;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #373b41;
  color: #f3efe8;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #f3efe8;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #969896;
}
atom-text-editor .invisible,
:host .invisible {
  color: #f3efe8;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #404349;
}
atom-text-editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
atom-text-editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.line.cursor-line {
  background-color: #373b41;
}
.comment {
  color: #969896;
}
.entity.name.type {
  color: #f3efe8;
}
.entity.other.inherited-class {
  color: #f3efe8;
}
.entity.name.type.class {
  color: #f0c674;
}
.keyword {
  color: #81a2be;
}
.keyword.control {
  color: #b294bb;
}
.keyword.operator {
  color: #f3efe8;
}
.keyword.operator.class {
  color: #81a2be;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #de935f;
}
.storage {
  color: #b294bb;
}
.storage.modifier {
  color: #81a2be;
}
.constant {
  color: #cc6666;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #cc6666;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #b5bd68;
}
.constant.language {
  color: #f0c674;
}
.constant.other.placeholder {
  color: #b5bd68;
}
.variable {
  color: #bda4c5;
}
.variable.interpolation {
  color: #bf4040;
}
.variable.parameter.function {
  color: #f3efe8;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #141414;
}
.string {
  color: #b5bd68;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
  color: #969896;
}
.punctuation.definition.variable {
  color: #b294bb;
}
.punctuation.definition.string,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #f3efe8;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #7096b5;
}
.support.class {
  color: #f0c674;
}
.support.function {
  color: #f0c674;
}
.support.function.any-method {
  color: #81a2be;
}
.entity.name.function {
  color: #f3efe8;
}
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.class {
  color: #f3efe8;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #b294bb;
}
.entity.other.attribute-name {
  color: #de935f;
}
.entity.other.attribute-name.id {
  color: #81a2be;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #373b41;
  color: #f3efe8;
}
.none {
  color: #f3efe8;
}
.markup.bold {
  color: #de935f;
  font-style: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bd68;
}
atom-text-editor[mini] .scroll-view {
  padding-left: 1px;
}
.highlight .region {
  background-color: #373b41;
}
.line-number {
  background-color: #282a2e;
  border-right: solid #373b41 1px;
}
